  return (
    <div>
      <div>
        <h1>Senior Product Designer</h1>
        <p>posted 3 days ago</p>
        <p>Open</p>
      </div>
      <div>
        <span>
          <p>Deleware, USA</p>
        </span>
        <span>
          <p>$300k-$400k</p>
        </span>
      </div>
    </div>
  );
}

export default JobHeaderPage;
